create table mounts
(
    Name              mediumtext not null,
    Sex               tinyint    not null,
    TemplateId        int        not null,
    Experience        bigint     not null,
    GivenExperience   tinyint    not null,
    Stamina           int        not null,
    Maturity          int        not null,
    Energy            int        not null,
    Serenity          int        not null,
    Love              int        not null,
    ReproductionCount int        not null,
    BehaviorsCSV      mediumtext not null,
    OwnerId           int        null,
    OwnerName         mediumtext null,
    PaddockId         int        null,
    IsInStable        tinyint    not null,
    StoredSince       datetime   null,
    Id                int        not null
        primary key
)
    engine = MyISAM
    charset = utf8;

create index OwnerId
    on mounts (OwnerId);

create index PaddockId
    on mounts (PaddockId);

